Edge of Darkness (2010)

Verenigd Koninkrijk / Verenigde Staten
Drama / Thriller
117 minuten

geregisseerd door Martin Campbell
met Mel Gibson, Ray Winstone en Danny Huston

Thomas Craven is een rechercheur, wiens dochter vlak voor zijn huis is vermoord. Men gaat ervan uit dat hijzelf het doelwit was, maar als Craven in het verleden van zijn dochter duikt, blijkt dat ze een gevaarlijke doofpotaffaire heeft ontdekt . Daarbovenop ontdekt hij dat er afspraken zijn tussen het bedrijf waar ze werkte en de overheid, waarbij ze iemand inhuren om het bewijs te vernietigen.

